import React from 'react';
import './Header.css';
import Mypic from '../Untitled design (1).png';
import Giffy from '../yy3.gif';
import Cv from '../cv.png';
import Mygif from '../source.gif';
// import Giff2 from '../60203889.png';

const Header = () =>{
    return(
        <div>
            <div className="imgdiv">

                <img className="giffy" src={Giffy} width="250px" ></img>
            <div className="bord">
            <div className="title">
            <img src={Mypic} className="Mypic"></img>
            <h1 className="myname"> ANUDEEP AYILALATH PUTHALATH  <span className="p">
            <p>"I am an enthusiastic and hardworking front-end developer <br></br>committed to learning and developing creative solutions. 
                I consider the trust and satisfaction <br></br>from my superiors and colleagues to be the most valuable assets in my professional career."
            </p></span></h1>
            <img className="mygif" width=" 200px"src={Mygif}></img>
            </div>
            <h1 className="expert">Areas Of Expertise</h1>
                <div className="iconz">
                    <img src="https://media1.giphy.com/media/ln7z2eWriiQAllfVcn/source.gif" width="100px"></img>
                    <img src="https://media1.giphy.com/media/RJzm826vu7WbJvBtxX/giphy.gif" width="100px"></img>
                    <img src="https://cdn.iconscout.com/icon/free/png-512/node-js-1174925.png" width="100px"></img>
                    <img src="https://media2.giphy.com/media/XAxylRMCdpbEWUAvr8/giphy.gif" width="100px"></img>
                        <img src="https://media2.giphy.com/media/fsEaZldNC8A1PJ3mwp/source.gif" width="100px"></img>
                        <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/2/29/Postgresql_elephant.svg/1200px-Postgresql_elephant.svg.png" width="88px"></img>

                </div>






                </div>
            </div>
        </div>
    )
}

export default Header;
